import { Component } from "react";

class SignUp extends Component{
    render(){
        return(
            <div>

                <form>
                <div className = "main-div">
                <h1>Signup to Affiliated market</h1>
                <div style={{paddingTop : "10px", paddingBottom : "10px"}}>


                    <div >
                    <span style={{paddingRight:"100px", textAlign:"left"}}>
                        Name :
                    </span>
                    <span> 


                             <input id="userid-text"
                                type="text" 
                               // value= {this.state.username} 
                                name= "username" 
                                //onChange= {this.changeUsername}
                                placeholder="User Name"
                             />

</span> 
                    </div>

                </div>
                <div style={{paddingTop : "10px", paddingBottom : "10px"}}>
                    <div >
                    <span style={{paddingRight:"100px", textAlign:"left"}}>Email :</span>
                        <span>
                        <input id="userid-text"
                                type="password" 
                                //value= {this.state.password} 
                                name= "password" 
                                //onChange= {this.changePassword}
                                placeholder="Password"
                            />
                        </span>

                    </div>
                </div>
                <div style={{paddingTop : "10px", paddingBottom : "10px"}}>
                    <div >
                    <span style={{paddingRight:"70px", textAlign:"left"}}>Password :</span>
                        <span>
                        <input id="userid-text"
                                type="password" 
                                //value= {this.state.password} 
                                name= "password" 
                                //onChange= {this.changePassword}
                                placeholder="Password"
                            />
                        </span>

                    </div> 
                </div>
                <div style={{paddingTop : "10px", paddingBottom : "10px"}}>
                    <div >
                    <span style={{paddingRight:"5px", textAlign:"left"}}>Confirm Password :</span>
                        <span>
                        <input id="userid-text"
                                type="password" 
                                //value= {this.state.password} 
                                name= "password" 
                                //onChange= {this.changePassword}
                                placeholder="Password"
                            />
                        </span>

                    </div>
                </div>
                <div style={{paddingTop : "10px", paddingBottom : "10px"}}>
                    <button className ="btn" type="submit" onClick={this.submitData}> Login </button>
                </div>
            </div>
            </form>
            </div>


        )
    }
}

export default SignUp
